import './App.css';
import {BrowserRouter as Router, Route} from 'react-router-dom'
import Home from './components/Home';
import Header from './components/Header';

function App() {
  return (
    <Router>
    <div>
    <Header />
      <Route exact path="/" element={ <Home/> } />
      </div>
    </Router>

  );
}

export default App;
